Setting up the dependency Glean is published on maven.mozilla.org . To use it, you need to add the following to your project's top-level build file, in the allprojects block (see e.g. Glean's own build.gradle ): repositories { maven { url "https://maven.mozilla.org/maven2" }
} Each module that uses Glean needs to specify it in its build file, in the dependencies block. Add this to your Gradle configuration: implementation "org.mozilla.components:service-glean:{latest-version}" Important: the {latest-version} placeholder in the above link should be replaced with the version number of the Glean SDK used by the project. For example, if version 6.0.2 is used, then the include directive becomes: implementation "org.mozilla.components:service-glean:6.0.2" The Glean SDK is released as part of android-components . Therefore, it follows android-components' versions. The android-components release page can be used to determine the latest version. Integrating with the build system In order for the Glean SDK to generate an API for your metrics, two Gradle plugins must be included in your build: The Glean Gradle plugin JetBrains' Python envs plugin The Glean Gradle plugin is distributed through Mozilla's Maven, so we need to tell your build where to look for it by adding the following to the top of your build.gradle: buildscript { repositories { maven { url "https://maven.mozilla.org/maven2" } dependencies { classpath "org.mozilla.telemetry:glean-gradle-plugin:{latest-version}" } }
} Important: as above, the {latest-version} placeholder in the above link should be replaced with the version number of the Glean SDK used by the project. The JetBrains Python plugin is distributed in the Gradle plugin repository, so it can be included with: plugins { id "com.jetbrains.python.envs" version "0.0.26"
} Right before the end of the same file, we need to apply the Glean Gradle plugin: apply plugin: "org.mozilla.telemetry.glean-gradle-plugin" There are additional parameters that can be set to control the behavior of the Glean Gradle plugin, but they are rarely needed for normal use. Note: Earlier versions of Glean used a Gradle script (sdk_generator.gradle) rather than a Gradle plugin. Its use is deprecated and projects should be updated to use the Gradle plugin as described above. Setting up the dependency Glean can be consumed through Carthage , a dependency manager for macOS and iOS. For consuming the latest version of Glean, add the following line to your Cartfile:: github "mozilla/glean" "master" Integrating with the build system Note: This is not yet documented, as the exact mechanism is not finalized. See Bug 1589383 for more information. It is recommended that you use a virtual environment for your work to isolate the dependencies for your project. There are many popular abstractions on top of virtual environments in the Python ecosystem which can help manage your project dependencies. The Python Glean bindings currently have prebuilt wheels on PyPI for x86_64 Linux only . If you're running that platform and have your virtual environment set up and activated, you can install Glean into it using: $ python -m pip install glean_sdk If you are not on x86_64 Linux, you will need to build the Glean Python bindings from source using these instructions .

